  false,\n\t\"url\": null,\n\t\"notes\": \"Proposal for 2008-2009 mortality surveillance
  for Highly Pathogenic Avian Influenza (HPAI) at Kulm Wetland Management District
  in North Dakota.  Surveillance will focus on priority species known to be sensitive
  to HPAI. Mortality surveys will be focused on designated routes of 11 Waterfowl
  Production Areas which have high known concentrations of the sensitive species.
  Surveillance will be through observation along wetlands on a weekly basis from April
  1, 2008 through November 7, 2008 for migration and throughout the breeding season
  and from March 2, 2009 through March 31, 2009 for the spring migration, with surveys
  on foot and ATV. Wetlands will be scanned with a spotting scope and binoculars.
  Carcasses of species detected during mortality surveillance efforts will be collected,
  properly packaged and shipped to an accredited laboratory for HPAI detection and
  cause-of-death determination.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
